<html lang="en"><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">

    <title>Well Being's Card</title>
    <style>
      /* Basic reset */
      @page {
        size: A4;
        margin: 0;
        /* Margins for the page */
        box-sizing: border-box;
      }

      #card {
        width: 3.4in;
        height: 2.2in;
        border: 1px solid rgb(158, 158, 158);
        overflow: hidden;
        position: relative;
      }

      #flex {
        display: flex;
      }

      #triangledown {
        width: 100%;
        height: 0.4in;
        background: #45b653;
      }

      .triangle-down {
        width: 0;
        height: 0;
        left: -7.5%;
        border-left: 120px solid transparent;
        border-right: 120px solid transparent;
        border-top: 110px solid #45b653;
        position: absolute;
      }

      .triangle-up {
        z-index: -1;
        position: absolute;
        top: 0.4in;
        left: -14.5%;
        width: 0;
        height: 0;
        border-left: 135px solid transparent;
        border-right: 135px solid transparent;
        border-top: 110px solid #a8cf45;
      }

      #circle {
  width: 0.82in;
  height: 1in;
  position: absolute; /* Set to relative for correct positioning of pseudo-elements */
  border-radius: 15px;
  border: 2.5px solid #55C35D;
  left: 70%;
  top: 33%;
  background: #00b3ff;
  overflow: hidden;
  z-index: 0;
}
#pic{
  width: 100%;
  margin: auto; height: 100%; left: 0px; top: 0px; display: block;
  /* object-fit: contain; */
}
      #bottom {
        bottom: 0.1in;
        position: absolute;
        width: 100%;
      }

      #name {
        text-transform: uppercase;
      }

      #gname {
        text-transform: uppercase;
      }

      select {
            border: none; /* Removes the border */
            outline: none; /* Removes the outline */
            background-color: transparent; /* Optional: makes background transparent */            
            -webkit-appearance: none;
            appearance: none;
            font-family: Impact, Haettenschweiler, 'Arial Narrow Bold', sans-serif;
            font-size: 12pt;            
        }
        #camaddress{
            height: 0.2in;padding: 0.02in 0.1in 0 0.1in;
        }
        
      /* Print-specific styles */
      @media print {
        body{
          -webkit-print-color-adjust: exact;
          print-color-adjust: exact;
        }
        @page {
          size: A4;
          margin: 0;
          /* Margins for the page */
          padding: 0;
        }

        button {
          display: none;
        }

        #page {
          position: relative;
          overflow: hidden;
          width: 210mm;
          height: 297mm;
          padding: 0;
          /* Padding inside the div */
          margin: 0;
          /* Margin outside the div */
          box-sizing: border-box;
          /* Include padding and border in element's total width and height */
          page-break-before: always;
          page-break-after: always;
          break-inside: avoid;
        }

        #page #flex:nth-child(5n+2) {
          position: absolute;
          top: 1.75in;
        }

        #page #flex:nth-child(5n+3) {
          position: absolute;
          top: 4in;
        }

        #page #flex:nth-child(5n+4) {
          position: absolute;
          top: 6.25in;
        }

        #page #flex:nth-child(5n+5) {
          position: absolute;
          top: 8.5in;
          /* bottom:0.01in               */
        }

        #page #flex {
          position: relative;
          margin: auto;
        }

        #page #flex #card:nth-child(1) {          
          border: none;
        }

        #page #flex #card:nth-child(2) {          
          border: none;
        }
      }
      .oval {
    overflow: hidden;
    position: absolute;
    top: -1.3in;
    left: -5px;
    height: 270px;
    width: 105%;
    background-color: #0050A3;
    border-radius: 60%;
    z-index: 0; /* Make sure the ::before oval stays behind the parent oval */
}
.ovalbottom {
    overflow: hidden;
    position: absolute;
    bottom: -1.3in;
    left: -5px;
    height: 270px;
    width: 105%;
    background-color: #0050A3;
    border-radius: 60%;
    z-index: 0; /* Make sure the ::before oval stays behind the parent oval */
    text-align: center;
    font-size: 8pt;
    font-family: Arial, Helvetica, sans-serif;    
    color: white;        
}
#bottomtext{
  text-align: center;
    font-size: 7pt;
    font-family: Arial, Helvetica, sans-serif;    
    color: white;
    width: 100%;
    position: absolute;
    bottom: 0.3in;
    line-height: 1.5;
}
#fronttable {
  position: absolute;
  top: 0.8in;
  left: 0.2in;   /* Added */  
  font-family: Arial, Helvetica, sans-serif;
  color: #0A3963;  
  font-size: 8pt;  
  padding: 0;
  text-wrap: nowrap;
  margin: auto; /* This will now work */
  line-height: 1.4;
}
#directorsign{
  display: none;
  width: 0.67in;
  height: 0.62in;
  position: absolute;
  bottom: 0.11in;
  right: 0.2in;  
}
#signcontainer{
  position: absolute;
  bottom: 0.22in;
  left: 0.1in;
  width: 1in;
  height: 0.4in;  
}

    const range = document.createRange();
    const selection = window.getSelection();
    range.selectNodeContents(element);

    selection.removeAllRanges(); // Clear any existing selection
    selection.addRange(range); // Add the new range
}

const cnicInput = document.querySelectorAll("#cnic"); // Ensure this is your input field ID

cnicInput.forEach(function(e) {
    e.addEventListener("input", function() {
        // Get the raw value from the input
        let cleanedValue = this.innerText.replace(/\D/g, ''); // Remove non-digit characters

        // Limit the length to 13 digits (the max length for a CNIC)
        cleanedValue = cleanedValue.substring(0, 13);

        // Format the cleaned value as 00000-0000000-0
        let formattedValue = '';
        if (cleanedValue.length > 0) {
            formattedValue += cleanedValue.slice(0, 5); // First 5 digits
        }
        if (cleanedValue.length > 5) {
            formattedValue += '-' + cleanedValue.slice(5, 12); // Next 7 digits
        }
        if (cleanedValue.length > 12) {
            formattedValue += '-' + cleanedValue.charAt(12); // Last digit
        }

        this.innerText = formattedValue; // Update the editable cell with the formatted value
        setCursorToEnd(this); // Optional: Move cursor to the end
    });
});

}

// Function to handle the paste event
function pasteHandler(event, element, isSignatureContainer = false) {
  const items = (event.clipboardData || window.clipboardData).items;
  const imageItem = [...items].find(item => item.type.startsWith("image"));

  if (imageItem) {
    event.preventDefault();
    const file = imageItem.getAsFile();
    const reader = new FileReader();

    reader.onload = e => {
      const img = new Image();
      img.src = e.target.result;
      img.onload = () => {
        if (isSignatureContainer) {
        // Create a canvas element to manipulate the image
        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("2d");

        // Set canvas dimensions to the image dimensions
        canvas.width = img.width;
        canvas.height = img.height;

        // Draw the image onto the canvas
        ctx.drawImage(img, 0, 0);

        // Get the pixel data
        const imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
        const data = imageData.data;

        // Enhance contrast
        enhanceContrast(data);

        // Remove white pixels
        for (let i = 0; i < data.length; i += 4) {
          // Check if the pixel is white (R, G, B all above a threshold)
          if (data[i] >= 245 && data[i + 1] >= 245 && data[i + 2] >= 245) {
            data[i + 3] = 0; // Set alpha to 0 (transparent)
          }
        }

        // Put the modified image data back onto the canvas
        ctx.putImageData(imageData, 0, 0);

        // Convert canvas to data URL
        const modifiedImageUrl = canvas.toDataURL();

        
          // Load image into #signcontainer img
          const signatureImg = element.querySelector("#signcontainer img");
          if (signatureImg) {
            signatureImg.src = modifiedImageUrl;
            signatureImg.style.width = "100%"; // Adjust as needed
          }
        } else {
          // Load image into #circle img
          element.querySelectorAll("#circle img").forEach(img => {
            img.src = e.target.result;
            img.style.width = "100%"; // Adjust as needed
          });
        }
      };
    };
    reader.readAsDataURL(file);
  }
}

// Function to enhance the contrast of the image data
function enhanceContrast(data) {
  let min = 255;
  let max = 0;

  // Find the min and max pixel values for R, G, B channels
  for (let i = 0; i < data.length; i += 4) {
    min = Math.min(min, data[i], data[i + 1], data[i + 2]);
    max = Math.max(max, data[i], data[i + 1], data[i + 2]);
  }

  // Apply contrast stretching
  const range = max - min;

  if (range > 0) {
    for (let i = 0; i < data.length; i += 4) {
      // Stretch the pixel values to enhance contrast
      data[i] = ((data[i] - min) / range) * 255;       // Red
      data[i + 1] = ((data[i + 1] - min) / range) * 255; // Green
      data[i + 2] = ((data[i + 2] - min) / range) * 255; // Blue
    }
  }
}

// Attach paste event listeners to all existing #flex elements
document.querySelectorAll("#flex").forEach(function (el) {
  el.addEventListener("paste", function (event) {
    const signContainer = el.querySelector("#signcontainer");
    // Check if the paste event is directly on #signcontainer
    if (event.target === signContainer) {
      console.log("Paste detected in #signcontainer");
      pasteHandler(event, signContainer, true); // Handle paste for #signcontainer
    } else if (!signContainer.querySelector("img") || event.target !== signContainer.querySelector("img")) {
      // Handle paste for other #flex elements only if no image is present in #signcontainer
      pasteHandler(event, el); // Handle paste for #flex
    }
  });
});

// Observer for dynamically added #signcontainer elements
const observer = new MutationObserver((mutations) => {
  mutations.forEach((mutation) => {
    if (mutation.addedNodes.length > 0) {
      document.querySelectorAll("#signcontainer").forEach((container) => {
        // Only add the listener if it hasn't been added yet
        if (!container.dataset.listenerAdded) {
          container.dataset.listenerAdded = "true"; // Mark as added
          container.addEventListener("paste", function (event) {
            console.log("Paste detected in dynamically added #signcontainer");
            pasteHandler(event, container, true); // Handle paste for #signcontainer
          });
        }
      });
    }
  });
});

document.querySelector("#cards").addEventListener("click", function() {
    const scriptTag = document.querySelector("script");
    const pages = document.querySelectorAll("#page");
    const clonedPage = pages[pages.length - 1].cloneNode(true);
    const tau = scriptTag.parentNode.insertBefore(clonedPage, scriptTag);
    
    tau.querySelectorAll("#pic").forEach(function(e) {
      e.removeAttribute("src");
    });
    
    tau.querySelectorAll("span").forEach(function(e) {
        e.innerHTML = "&nbsp;";
        e.style.border = "1px solid black"
        e.setAttribute("tabindex", "0"); // Make span focusable
        
        e.addEventListener("focus", function() {
          if (e.innerHTML === "&nbsp;"){
            e.innerText = ""; // Clear inner text on focus
          }
        });
        e.addEventListener("blur", function() {
            if (e.innerText === ""){
            e.innerHTML = "&nbsp;";            
            } else{
                e.style.border = "none";
            }
        });
    });
    document.querySelectorAll("[id='campus-select']").forEach(function(tau){
    tau.addEventListener("change", function(e){
    e.target.parentElement.parentElement.querySelector("#camaddress").innerText = e.target.querySelectorAll("option")[e.target.selectedIndex].value;
    });
    })
});

document.querySelectorAll('#campus-select').forEach(function(e) {
    function showSelect() {
        const select = document.createElement('select');

        // Populate the select options
        addresses.forEach((item) => {
            const option = document.createElement('option');
            option.value = item.A;
            option.textContent = item.N.toLocaleUpperCase();
            select.appendChild(option);
        });

        // When the select changes
        select.addEventListener('change', function() {
            const selectedOption = select.options[select.selectedIndex];
            select.parentElement.parentElement.querySelector("#camaddress").innerHTML = selectedOption.value;
            e.innerText = selectedOption.textContent; // Set the text of the div
            replaceWithDiv(); // Replace the select back with div
        });

        // When the select loses focus
        select.addEventListener('blur', function() {
            replaceWithDiv(); // Replace the select back with div
        });

        // Replace the div with the select
        e.parentNode.replaceChild(select, e);
        select.focus(); // Focus on the select element
    }

    function replaceWithDiv() {
        const newDiv = document.createElement('div');
        newDiv.id = 'campus-select'; // Set the ID again for consistency
        newDiv.tabIndex = 0;
        newDiv.textContent = e.innerText; // Retain the selected text

        // Reattach the click event
        newDiv.addEventListener('click', showSelect);

        // Replace the select with the new div
        const select = document.querySelector('select'); // This should now only find the one we just created
        select.parentNode.replaceChild(newDiv, select);
    }

    // Add click event to the div
    e.addEventListener('click', showSelect);
});

const rows = document.querySelectorAll("#fronttable tr:nth-child(1)");
for (const e of rows) {
    if (e.textContent === '\u00A0') {  // \u00A0 is the Unicode for &nbsp;
        e.focus();
        e.scrollIntoView();
        break;  // Stop after the first match
    }
}

document.querySelector("#arrange").addEventListener("click", function(e){
  document.querySelectorAll("#page").forEach(function(tau){
    if (tau.style.display === "none"){
      tau.remove();      
    }    
  })  
    // Get all #page elements
  const pages = document.querySelectorAll("#page");
  
  if (pages.length > 0) {
    const firstPage = pages[0]; // First #page element

    // Loop through all other #page elements except the first one
    for (let i = 1; i < pages.length; i++) {
      const currentPage = pages[i];
      
      // Get all #flex elements in the current #page
      const flexElements = currentPage.querySelectorAll("#flex");
      
      // Append each #flex element to the first #page
      flexElements.forEach(function(flex) {
        firstPage.appendChild(flex);
      });
    }
  }
  
  // Select all elements with the ID #flex
let allFlexElements = document.querySelectorAll("#flex");

// Iterate over each #flex element
allFlexElements.forEach(function(flexElement) {
    // Select all td elements within the current #flex
    let tds = flexElement.querySelectorAll("td");

    // Indices to check: 0, 2, 4, 6, 8, 11, 13, 15
    let indices = [0, 2, 4, 6, 8, 11, 13, 15];
    let shouldMoveFlex = false;

    // Check if any of the specific tds are empty
    indices.forEach(function(index) {
        if (tds[index] && tds[index].textContent.trim() === "") {
            shouldMoveFlex = true;
        }
    });

    // Move the current #flex to the end of #page if any td is empty
    if (shouldMoveFlex) {
        let pageElement = document.querySelector("#page");
        pageElement.appendChild(flexElement);  // Move #flex to the end of #page
    }
});

const flexElements = document.querySelectorAll('#flex');
  const page = document.querySelectorAll('#page');
  
  let groupSize = 5;
  
  flexElements.forEach((flexElement, index) => {
    const pageIndex = Math.floor(index / groupSize);
    if (page[pageIndex]) {
      page[pageIndex].appendChild(flexElement);
    }
  });

})
